(window.webpackJsonp=window.webpackJsonp||[]).push([[1263],{1286:function(p){p.exports={chapterTitle:null,title:"\u7b2c\u5341\u4e09\u8282 \u51fa\u5c14\u53cd\u5c14",content:"<article><h2>\u7b2c\u5341\u4e09\u8282 \u51fa\u5c14\u53cd\u5c14</h2><p>\u4e16\u754c\u4e0a\u7684\u95ee\u9898\uff0c\u7d20\u6765\u90fd\u662f\u56e0\u4eba\u800c\u5f02\u3002\u5982\u679c\u5361\u7433\u5a1c\u5a01\u80c1\u7684\u5bf9\u8c61\u662f\u743c\u6069\uff0c\u90a3\u663e\u7136\u662f\u5979\u8111\u888b\u574f\u4e86\uff0c\u743c\u6069\u56fa\u7136\u8bf4\u4e0d\u4e0a\u5927\u5978\u5927\u6076\u4e4b\u5f92\uff0c\u4e5f\u51b3\u4e0d\u4f1a\u662f\u4ec0\u4e48\u6b63\u4eba\u541b\u5b50\u3002\u8981\u4ed6\u4e3a\u4e86\u4e00\u7fa4\u65e0\u4eb2\u65e0\u6545\u7684\u4eba\u727a\u7272\u81ea\u5df1\uff0c\u90a3\u7b80\u76f4\u662f\u5929\u5927\u7684\u7b11\u8bdd\u3002</p><p>\u867d\u7136\u4ece\u540d\u4e49\u4e0a\u8bf4\uff0c\u4ed6\u5982\u4eca\u662f\u8fd9\u652f\u8d1d\u6234\u86ee\u65cf\u90e8\u843d\u7684\u65cf\u957f\uff0c\u4f46\u8fd9\u4e0d\u8fc7\u662f\u6743\u5b9c\u4e4b\u8ba1\u7f62\u4e86\u3002\u5927\u5bb6\u840d\u6c34\u76f8\u9022\uff0c\u90fd\u88ab\u56f0\u5728\u6c99\u6f20\u91cc\uff0c\u76f8\u4e92\u5408\u4f5c\u6446\u8131\u56f0\u5883\u800c\u5df2\uff0c\u54ea\u91cc\u8c08\u5f97\u4e0a\u771f\u6709\u4ec0\u4e48\u4ea4\u60c5\u3002\u9000\u4e00\u6b65\u8bf4\uff0c\u5c31\u7b97\u771f\u6709\u4ea4\u60c5\uff0c\u743c\u6069\u4e5f\u6ca1\u50bb\u5230\u4f1a\u53bb\u76f8\u4fe1\u4eba\u9762\u72ee\u3002\u8fd9\u79cd\u8001\u5957\u65e0\u6bd4\u7684\u5267\u60c5\uff0c\u7535\u89c6\u5267\u91cc\u90fd\u4e0d\u77e5\u89c1\u8fc7\u591a\u5c11\u904d\u4e86\u3002</p><p>\u6240\u4ee5\u5361\u7433\u5a1c\u4e5f\u6ca1\u6253\u7b97\u53bb\u5a01\u80c1\u743c\u6069\u2014\u2014\u5979\u7684\u6ce8\u610f\u529b\u5b8c\u5168\u96c6\u4e2d\u5728\u6885\u83f2\u65af\u8eab\u4e0a\uff0c\u6839\u672c\u5c31\u6ca1\u770b\u89c1\u8fdc\u8fdc\u8eb2\u7740\u7684\u743c\u6069\u3002</p><p>\u5bf9\u4e8e\u743c\u6069\u6765\u8bf4\u6839\u672c\u4e0d\u662f\u95ee\u9898\u7684\u95ee\u9898\uff0c\u5bf9\u4e8e\u6885\u83f2\u65af\u548c\u7267\u5e08\u6765\u8bf4\uff0c\u4f3c\u4e4e\u5c31\u6bd4\u8f83\u662f\u4e2a\u95ee\u9898\u4e86\u3002</p><p>\u8001\u65cf\u957f\u66fe\u7ecf\u8bf4\u8fc7\uff0c\u8fd9\u4e09\u4e2a\u7267\u5e08\uff0c\u4e24\u4e2a\u662f\u5170\u68ee\u5fb7\u5c14\u7684\u4fe1\u5f92\uff0c\u4e00\u4e2a\u662f\u63d0\u5c14\u7684\u4fe1\u5f92\uff0c\u6885\u83f2\u65af\u5e94\u8be5\u662f\u63d0\u5c14\u7684\u5723\u6b66\u58eb\u3002\u6668\u66e6\u4e4b\u795e\u5170\u68ee\u5fb7\u5c14\u4e5f\u597d\uff0c\u6b63\u4e49\u4e4b\u795e\u63d0\u5c14\u4e5f\u597d\uff0c\u5171\u901a\u7684\u7279\u70b9\u662f\uff1a\u90fd\u662f\u5584\u795e\u3002</p><p>\u5f53\u7136\uff0c\u5584\u795e\u7684\u4fe1\u5f92\u5e76\u975e\u4e00\u5b9a\u4e5f\u5c31\u662f\u5584\u826f\u7684\u4eba\u3002\u4f46\u73b0\u5728\u8fd9\u51e0\u4f4d\u4e0d\u662f\u666e\u901a\u7684\u4fe1\u5f92\uff0c\u4ed6\u4eec\u662f\u9ad8\u9636\u7267\u5e08\u548c\u5723\u6b66\u58eb\u3002\u8fd9\u662f\u4e2a\u795e\u7947\u771f\u5b9e\u5b58\u5728\u7684\u4e16\u754c\uff0c\u8d8a\u9ad8\u9636\u7684\u7267\u5e08\uff0c\u4ed6\u4eec\u7684\u7cbe\u795e\u548c\u795e\u7947\u8054\u63a5\u5f97\u8d8a\u7d27\u5bc6\uff0c\u4ed6\u4eec\u7684\u7406\u5ff5\u548c\u795e\u7947\u8d8a\u5951\u5408\uff0c\u4ed6\u4eec\u7684\u4e3a\u4eba\u5904\u4e16\u8d8a\u7b26\u5408\u795e\u7947\u7684\u6559\u5bfc\uff0c\u5426\u5219\u65e9\u88ab\u964d\u683c\u5f00\u9664\u4e86\u3002</p><p>\u81f3\u4e8e\u5723\u6b66\u58eb\uff0c\u90a3\u66f4\u4e0d\u7528\u8bf4\u4e86\u3002\u5723\u6b66\u58eb\u7684\u51c6\u5219\uff0c\u662f\u7ef4\u62a4\u79e9\u5e8f\uff0c\u5e87\u62a4\u5584\u826f\uff0c\u6253\u51fb\u90aa\u6076\uff0c\u4ece\u67d0\u79cd\u610f\u4e49\u4e0a\u8bf4\uff0c\u5c31\u7b49\u82e5\u662f\u6b63\u4e49\u7684\u5316\u8eab\u3002</p><p>\u90a3\u4e48\uff0c\u9762\u5bf9\u8fd9\u79cd\u60c5\u51b5\uff0c\u4ed6\u4eec\u4f1a\u5982\u4f55\u9009\u62e9\u5462\uff1f</p><p>\u201c\u4e00\uff01\u201d</p><p>\u201c\u4e8c\uff01\u201d</p><p>\u201c\u4e09\uff01\u201d</p><p>\u5361\u7433\u5a1c\u7b11\u541f\u541f\u5730\u770b\u7740\u88ab\u5305\u56f4\u7684\u56db\u4eba\uff0c\u53e3\u4e2d\u4e0d\u7d27\u4e0d\u6162\u5730\u6570\u7740\u3002\u5979\u4eff\u4f5b\u5f88\u6709\u4fe1\u5fc3\uff0c\u6216\u8005\u8bf4\uff0c\u5bf9\u5bf9\u65b9\u7684\u4eba\u54c1\u5f88\u6709\u4fe1\u5fc3\u3002</p><p>\u7267\u5e08\u4eec\u72b9\u8c6b\u7740\uff0c\u6700\u540e\u90a3\u4e2a\u53eb\u5766\u7eb3\u65af\u7684\u7ea2\u5934\u53d1\u5170\u68ee\u5fb7\u5c14\u7267\u5e08\u4eff\u4f5b\u505a\u4e86\u4e2a\u51b3\u5b9a\uff0c\u4ed6\u4f38\u624b\uff0c\u5c06\u4e00\u76f4\u80cc\u5728\u80cc\u4e0a\u7684\u5305\u88f9\u53d6\u4e86\u4e0b\u6765\uff0c\u5c31\u8981\u6253\u5f00\uff0c\u5374\u88ab\u65c1\u8fb9\u7684\u6885\u83f2\u65af\u4f38\u624b\u6309\u4f4f\u4e86\u3002</p><p>\u201c\u4e0d\u884c\uff01\u201d\u6885\u83f2\u65af\u6c89\u58f0\u8bf4\uff0c\u201c\u4e0d\u80fd\u7528\u5b83\u3002\u201d</p><p>\u201c\u6ca1\u522b\u7684\u65b9\u6cd5\uff0c\u201d\u5766\u7eb3\u65af\u6297\u8fa9\u7740\uff0c\u201c\u6211\u4eec\u4e0d\u80fd\u675f\u624b\u5f85\u6bd9\u3002\u201d</p><p>\u201c\u4e0d\u884c\u3002\u201d\u6885\u83f2\u65af\u6beb\u4e0d\u9000\u8ba9\u3002</p><p>\u4ed6\u4eec\u4f4e\u58f0\u4e89\u6267\u7740\uff0c\u6700\u540e\u5766\u7eb3\u65af\u9000\u8ba9\u4e86\u3002\u201c\u597d\u5427\uff0c\u201d\u4ed6\u8bf4\uff0c\u201c\u4f46\u6211\u4eec\u600e\u4e48\u529e\uff1f\u201d</p><p>\u4ed6\u4eec\u88ab\u5305\u56f4\u7740\uff0c\u6885\u83f2\u65af\u521a\u624d\u4e00\u8def\u51b2\u8fdb\u6765\uff0c\u65a9\u6740\u4e86\u516d\u4e03\u4e2a\u4eba\u9762\u72ee\uff0c\u4f46\u5979\u7684\u4f53\u529b\u4f3c\u4e4e\u4e5f\u5df2\u7ecf\u6d88\u8017\u5f88\u5927\u3002\u7267\u5e08\u4e3a\u5979\u65bd\u52a0\u4e86\u795d\u798f\u5f3a\u5316\u795e\u672f\uff0c\u4f46\u8fd9\u65e0\u6cd5\u6d88\u9664\u75b2\u52b3\u3002</p><p>\u4eba\u529b\u603b\u662f\u6709\u7a77\u5c3d\u7684\u3002</p><p>\u4e09\u4e2a\u7267\u5e08\uff0c\u4e00\u4e2a\u5723\u6b66\u58eb\uff0c\u9876\u591a\u518d\u52a0\u4e00\u4e2a\u8eb2\u5728\u6697\u5904\u7684\u5deb\u5e08\uff0c\u9762\u5bf9\u7740\u7684\u654c\u4eba\u662f\u8fd1\u4e09\u5341\u4e2a\u4eba\u9762\u72ee\uff0c\u8fd9\u600e\u4e48\u770b\u600e\u4e48\u6ca1\u6709\u80dc\u7b97\u3002</p><p>\u800c\u4e14\uff0c\u5bf9\u65b9\u8fd8\u62ff\u8d1d\u6234\u86ee\u65cf\u5f53\u4eba\u8d28\u3002\u6668\u66e6\u4e4b\u795e\u548c\u6b63\u4e49\u4e4b\u795e\u7684\u7267\u5e08\uff0c\u80fd\u5750\u89c6\u602a\u7269\u5c60\u6740\u65e0\u8f9c\u5e73\u6c11\u800c\u4e0d\u7406\u5417\uff1f</p><p>\u72b9\u8c6b\u4e4b\u95f4\uff0c\u65f6\u95f4\u5df2\u7ecf\u4e00\u5206\u4e00\u79d2\u5730\u8fc7\u53bb\u3002\u5361\u7433\u5a1c\u5df2\u7ecf\u6570\u5230\u201c\u4e03\u201d\uff0c\u5979\u8138\u4e0a\u7684\u7b11\u610f\u66f4\u6d53\uff0c\u4eff\u4f5b\u80dc\u5238\u5728\u63e1\u3002\u7136\u540e\u5979\u6ee1\u610f\u5730\u770b\u5230\uff0c\u5bf9\u9762\u51e0\u4e2a\u4eba\u7c7b\u5546\u8bae\u4f3c\u4e4e\u51fa\u4e86\u7ed3\u679c\uff0c\u51c6\u5907\u5c48\u670d\u3002</p><p>\u6885\u83f2\u65af\u62ac\u8d77\u5934\u6765\uff0c\u6380\u8d77\u5934\u76d4\u7684\u9762\u7f69\uff0c\u201c\u597d\u5427\uff0c\u201d\u5979\u8bf4\uff0c\u201c\u6211\u4eec\u6295\u964d\uff0c\u4f46\u4f60\u5fc5\u987b\u5148\u628a\u4ed6\u4eec\u653e\u4e86\u3002\u201d</p><p>\u201c\u8fd9\u4f3c\u4e4e\u4e0d\u592a\u516c\u5e73\uff0c\u201d\u5361\u7433\u5a1c\u8bf4\uff0c\u4f46\u8bed\u6c14\u5e76\u4e0d\u575a\u51b3\uff0c\u201c\u4e00\u624b\u4ea4\u94b1\uff0c\u4e00\u624b\u4ea4\u8d27\u3002\u201d</p><p>\u201c\u628a\u4ed6\u4eec\u5148\u653e\u4e86\u3002\u201d\u6885\u83f2\u65af\u575a\u6301\u3002</p><p>\u201c\u6211\u542c\u8bf4\u63d0\u5c14\u7684\u5723\u6b66\u58eb\u51b3\u4e0d\u4f1a\u6492\u8c0e\u3002\u201d\u5361\u7433\u5a1c\u7b11\u610f\u76c8\u76c8\u5730\u770b\u7740\u5bf9\u65b9\u3002</p><p>\u201c\u6211\u662f\u4e2a\u5723\u6b66\u58eb\u3002\u201d\u6885\u83f2\u65af\u7b80\u77ed\u5730\u56de\u7b54\u3002</p><p>\u5361\u7433\u5a1c\u5475\u5475\u7b11\u4e86\u8d77\u6765\uff0c\u53e3\u4e2d\u53d1\u51fa\u5c16\u5229\u7684\u5578\u58f0\uff0c\u4eff\u4f5b\u662f\u67d0\u79cd\u4fe1\u53f7\u3002\u770b\u5b88\u8d1d\u6234\u86ee\u65cf\u7684\u4eba\u9762\u72ee\u542c\u5230\u547d\u4ee4\uff0c\u7f13\u7f13\u9000\u5f00\uff0c\u86ee\u65cf\u4eec\u60ca\u9b42\u672a\u5b9a\uff0c\u4e0d\u6562\u7f6e\u4fe1\u81ea\u5df1\u9003\u8131\u4e00\u52ab\uff0c\u8fd8\u5446\u5446\u5730\u7ad9\u7740\u4e0d\u52a8\u3002</p><p>\u201c\u8d70\u5427\u3002\u201d\u5361\u7433\u5a1c\u9ad8\u58f0\u8bf4\u3002</p><p>\u86ee\u65cf\u4eec\u8fd9\u624d\u53cd\u5e94\u8fc7\u6765\uff0c\u5f7c\u6b64\u6400\u6276\uff0c\u8dcc\u8dcc\u649e\u649e\u5730\u9003\u79bb\u5e7f\u573a\uff0c\u5f80\u57ce\u5916\u8dd1\u53bb\u3002\u4ed6\u4eec\u7684\u9a86\u9a7c\u5df2\u7ecf\u88ab\u4eba\u9762\u72ee\u63a0\u8d70\uff0c\u4e5f\u6ca1\u6709\u4eba\u6562\u53bb\u7d22\u8981\u3002\u867d\u7136\u5728\u8fd9\u832b\u832b\u6c99\u6d77\u4e4b\u4e2d\uff0c\u5931\u53bb\u4e86\u9a86\u9a7c\u548c\u8f8e\u91cd\u884c\u674e\uff0c\u5c31\u7b97\u9003\u51fa\u57c3\u65af\u8003\u57ce\uff0c\u4e5f\u5f88\u96be\u751f\u5b58\u4e0b\u53bb\uff0c\u4f46\u5982\u4eca\u5df2\u7ecf\u6ca1\u6709\u4eba\u987e\u5f97\u4e0a\u8003\u8651\u8fd9\u4e9b\u3002</p><p>\u770b\u89c1\u8d1d\u6234\u86ee\u65cf\u4eec\u7684\u8eab\u5f71\u4ece\u89c6\u7ebf\u4e2d\u6d88\u5931\uff0c\u5361\u7433\u5a1c\u6325\u4e86\u6325\u624b\u4e2d\u7684\u6cd5\u6756\u3002</p><p>\u201c\u73b0\u5728\uff0c\u4f60\u4eec\u8be5\u5c65\u884c\u627f\u8bfa\u4e86\u3002\u201d\u5979\u8bf4\uff0c\u770b\u7740\u6885\u83f2\u65af\u548c\u7267\u5e08\u4eec\u3002</p><p>\u6885\u83f2\u65af\u7f13\u7f13\u4fef\u8eab\uff0c\u5c06\u624b\u4e2d\u7684\u94f6\u5251\u653e\u5728\u811a\u8fb9\uff0c\u7267\u5e08\u4eec\u4e5f\u5206\u522b\u653e\u4e0b\u6218\u9524\u548c\u9489\u5934\u9524\u3002\u56db\u53ea\u4eba\u9762\u72ee\u4e0a\u524d\uff0c\u4ed6\u4eec\u5c06\u5f2f\u5200\u522b\u5728\u8170\u4e0a\uff0c\u53d6\u51fa\u7ef3\u7d22\uff0c\u51c6\u5907\u6293\u6355\u4fd8\u864f\u3002</p><p>\u4f46\u4ed6\u4eec\u521a\u521a\u9760\u8fd1\uff0c\u6885\u83f2\u65af\u9661\u7136\u6293\u8d77\u94f6\u5251\uff0c\u633a\u8eab\u6a2a\u626b\u3002\u5251\u8eab\u4e0a\u7efd\u51fa\u7729\u76ee\u767d\u5149\uff0c\u539f\u672c\u5c31\u5de8\u5927\u7684\u5251\u5203\u4eff\u4f5b\u53c8\u53d8\u5927\u4e86\u4e00\u500d\uff0c\u66f4\u52a0\u51cc\u5389\u950b\u9510\u3002\u4f17\u4eba\u90fd\u8fd8\u6ca1\u53cd\u5e94\u8fc7\u6765\u600e\u4e48\u56de\u4e8b\uff0c\u56db\u53ea\u4eba\u9762\u72ee\u90fd\u5df2\u7ecf\u8eab\u9996\u5f02\u5904\u3002\u6885\u83f2\u65af\u8fd9\u4e00\u5251\u5206\u5bf8\u62ff\u634f\u5f97\u6070\u5230\u597d\u5904\uff0c\u51e0\u4e4e\u5df2\u7ecf\u5230\u4e86\u51fa\u795e\u5165\u5316\u7684\u5730\u6b65\u3002</p><p>\u6885\u83f2\u65af\u4e00\u52a8\uff0c\u4e09\u4e2a\u7267\u5e08\u4e5f\u8ddf\u7740\u52a8\u8d77\u6765\uff0c\u4ed6\u4eec\u6284\u8d77\u6b66\u5668\uff0c\u4e00\u9f50\u5f80\u5916\u51b2\u6740\u3002\u4eba\u9762\u72ee\u4eec\u731d\u4e0d\u53ca\u9632\uff0c\u987f\u65f6\u9635\u578b\u88ab\u51b2\u4e71\uff0c\u4ed6\u4eec\u547c\u559d\u6012\u543c\u7740\uff0c\u53e3\u4e2d\u53d1\u51fa\u5947\u602a\u7684\u58f0\u97f3\uff0c\u5e94\u8be5\u662f\u4eba\u9762\u72ee\u7684\u8bed\u8a00\uff0c\u743c\u6069\u81ea\u7136\u542c\u4e0d\u61c2\u3002</p><p>\u5361\u7433\u5a1c\u6325\u821e\u7740\u6cd5\u6756\uff0c\u6307\u6325\u90e8\u4e0b\uff0c\u201c\u4f60\u4e0d\u5b88\u4fe1\u7528\uff01\u201d\u5979\u5389\u58f0\u6012\u559d\uff0c\u201c\u5723\u6b66\u58eb\u4e0d\u80fd\u6492\u8c0e\uff01\u201d</p><p>\u201c\u6211\u6ca1\u6709\u6492\u8c0e\u3002\u201d\u6885\u83f2\u65af\u6325\u5251\u903c\u9000\u4e86\u4e00\u53ea\u4eba\u9762\u72ee\uff0c\u4e00\u8fb9\u56de\u7b54\u3002</p><p>\u201c\u4f60\u6492\u8c0e\u4e86\uff01\u201d\u5361\u7433\u5a1c\u6307\u8d23\u3002</p><p>\u201c\u6211\u5728\u5fc3\u91cc\u6ca1\u6709\u6492\u8c0e\uff0c\u4f60\u5e94\u8be5\u77e5\u9053\u3002\u201d\u6885\u83f2\u65af\u56de\u7b54\u3002</p><p>\u201c\u6211\u600e\u4e48\u4f1a\u77e5\u9053\uff1f\u201d</p><p>\u201c\u662f\u4e48\uff0c\u90a3\u4f60\u771f\u4e0d\u806a\u660e\u3002\u201d</p><p>\u5361\u7433\u5a1c\u6124\u6012\u81f3\u6781\uff0c\u53cd\u5012\u8138\u8272\u4e00\u7f13\uff0c\u683c\u683c\u7b11\u4e86\u8d77\u6765\uff0c\u201c\u6709\u610f\u601d\uff0c\u6211\u8fd8\u4e00\u76f4\u4ee5\u4e3a\u5723\u6b66\u58eb\u90fd\u662f\u6b63\u76f4\u5b88\u4fe1\u7684\u4eba\u3002\u201d</p><p>\u6885\u83f2\u65af\u5e76\u4e0d\u56de\u7b54\uff0c\u6216\u8005\u8bf4\u4e0d\u5c51\u4e8e\u56de\u7b54\uff0c\u5979\u7528\u529b\u5288\u65ad\u4e00\u53ea\u4eba\u9762\u72ee\u7684\u524d\u80a2\uff0c\u8ba9\u5b83\u6454\u5012\u5728\u5730\uff0c\u7136\u540e\u4ece\u5b83\u8eab\u65c1\u8d8a\u8fc7\uff0c\u7267\u5e08\u4eec\u8ddf\u5728\u8eab\u540e\uff0c\u5de6\u53f3\u7ffc\u62a4\uff0c\u52bf\u4e0d\u53ef\u6321\u3002</p><p>\u5361\u7433\u5a1c\u51b7\u7b11\u7740\uff0c\u6325\u52a8\u6cd5\u6756\uff0c\u671d\u5730\u9762\u4e0a\u91cd\u91cd\u4e00\u6572\u3002\u5239\u90a3\u4e4b\u95f4\uff0c\u5e7f\u573a\u4e2d\u6240\u6709\u7684\u4eba\u9762\u72ee\u8eab\u5468\u90fd\u5e7b\u51fa\u51e0\u4e2a\u865a\u5e7b\u91cd\u5f71\uff0c\u63a5\u7740\u77ac\u5373\u5206\u79bb\uff0c\u51dd\u6210\u5b9e\u4f53\uff0c\u4e00\u9f50\u90fd\u6251\u4e0a\u6765\u3002</p><p>\u9661\u7136\u4e4b\u95f4\uff0c\u5bf9\u624b\u5c31\u589e\u52a0\u4e86\u51e0\u500d\u3002</p><p>\u8fd9\u663e\u7136\u662f\u67d0\u79cd\u5e7b\u672f\uff0c\u5361\u7433\u5a1c\u4e0d\u53ef\u80fd\u77ac\u95f4\u53ec\u5524\u51fa\u8fd9\u4e48\u591a\u540c\u4f34\u6765\u3002\u95ee\u9898\u5728\u4e8e\uff0c\u6240\u6709\u4eba\u90fd\u77e5\u9053\u8fd9\u662f\u5e7b\u672f\uff0c\u5374\u6ca1\u6cd5\u5206\u8fa8\u5176\u4e2d\u54ea\u4e9b\u662f\u5e7b\u8c61\uff0c\u54ea\u4e9b\u662f\u5b9e\u4f53\uff0c\u8fd9\u5c31\u5f88\u7cdf\u7cd5\u3002</p></article>"}}}]);
